import HomePage from '@/components/HomePage.vue'
import ClientList from '@/components/Client/ClientList.vue'

const routes = [
    {
        name: 'HomePage',
        path: '/',
        component: HomePage
    },
    {
        name: 'ClientList',
        path: '/clients',
        component: ClientList
    }
]

const router = createRouter({

})

